import React from "react";
import styled from "styled-components";

const StyleButton = styled.button`
  display: inline-block;
  height: 70px;
  width: 80%;
  border: none;
  border-radius: 15px;
  color: white;
  font-size: 1.2em;
  margin: 20px;
  cursor: pointer;
`;
const Button = (props) => {
  return <StyleButton onClick={props.onClick}>{props.text}</StyleButton>;
};

export default Button;
